import './checkput.scss';

const Checkout = () =>{
    return(
        <div className='checkout-pagr'>
            <div className="checkout-header">
                <div className="header-block">
                    <span>Pro</span>
                </div>
            </div>
        </div>
    )
}

export default Checkout;
